[<AbstractClass; Sealed; Extension>]
type FontExtensions() =

    static let lineBreak = System.Text.RegularExpressions.Regex @"\r?\n|\r"
        
    static let lineRx = System.Text.RegularExpressions.Regex @"([^\r\n]*)((\r?\n)|$)"

    [<Extension>]
    static member ToIndexedCodePointArray(str : string) =
        if str.Length > 0 then
            let mutable arr : struct(int * CodePoint)[] = Array.zeroCreate str.Length
            let mutable oi = 0
            let mutable c0 = str.[0] |> uint16
            let mutable lastSurrogate = (c0 &&& 0xF800us) = 0xD800us
            if lastSurrogate then
                c0 <- c0 &&& 0x27FFus
            else
                arr.[oi] <- struct(0, CodePoint(int c0))
                oi <- oi + 1

            for ii in 1 .. str.Length - 1 do
                let c1 = str.[ii] |> uint16
                if lastSurrogate then   
                    let v1 = c1 &&& 0x23FFus
                    let code = 0x10000 ||| (int c0 <<< 10) ||| int v1
                    arr.[oi] <- struct(ii-1, CodePoint(code))
                    oi <- oi + 1
                    lastSurrogate <- false
                elif (c1 &&& 0xF800us) = 0xD800us then
                    c0 <- c1 &&& 0x27FFus
                    lastSurrogate <- true
                else
                    arr.[oi] <- struct(ii, CodePoint(int c1))
                    oi <- oi + 1
                    
            if arr.Length > oi then System.Array.Resize(&arr, oi)
            arr
        else
            [||]
    
    [<Extension>]
    static member LayoutWithCharacterBounds(font : Font, color : C4b, align : TextAlignment, bounds : Box2d, content : string, renderStyle : RenderStyle) =
        let chars = System.Collections.Generic.List<float * Glyph>()
        let concrete = System.Collections.Generic.List<ConcreteShape>()
        
        let boundsList = System.Collections.Generic.List<struct(int * Box2d)>()
        let lineBounds = System.Collections.Generic.List<struct(int * Box2d)>()

        let mutable cy = 0.0
        //let allLines = lineBreak.Split content

        let mutable textBounds = Box2d.Invalid
        let mutable renderBounds = Box2d.Invalid

        let mutable stringOffset = 0
        let mutable m = lineRx.Match(content, stringOffset)


        while m.Length > 0 && m.Success && m.Index = stringOffset do
            let l = m.Groups.[1].Value
            let l = l.ToIndexedCodePointArray()
            let mutable cx = 0.0
            let mutable last = CodePoint '\n'
            chars.Clear()

            let mutable minX = 0.0
            let mutable i = 0

            for ci in 0 .. l.Length - 1 do
                let struct(si, c) = l.[ci]
                let si = stringOffset + si
                let kerning = font.GetKerning(last, c)

                let nextBefore =
                    if ci + 1 < l.Length then 
                        let struct(_,nc) = l.[ci + 1]
                        if nc.String = " " || nc.String = "\t" then 0.0
                        else
                            let g =  font |> Font.glyph c
                            if g.IsValid then g.Before
                            else 0.0
                    else
                        0.0

                let lll = if cx = 0.0 then System.Double.NegativeInfinity else cx

                match c.String with
                    | " " -> 
                        lineBounds.Add(struct(si, Box2d(lll, cy - font.Descent - font.InternalLeading, cx + font.Spacing + nextBefore, cy + font.Ascent + font.ExternalLeading)))
                        cx <- cx + font.Spacing
                    | "\t" -> 
                        let w = 4.0 * font.Spacing
                        lineBounds.Add(struct(si, Box2d(lll, cy - font.Descent - font.InternalLeading, cx + w + nextBefore, cy + font.Ascent + font.ExternalLeading)))
                        cx <- cx + w
                    | _ ->
                        let g = font |> Font.glyph c
                        let pos = cx + g.Before + kerning
                        chars.Add(pos, g)
                        lineBounds.Add(struct(si, Box2d(lll + g.Before + kerning, cy - font.Descent - font.InternalLeading, cx + kerning + g.Advance + nextBefore, cy + font.Ascent + font.ExternalLeading)))
                        cx <- cx + kerning + g.Advance
                        if i = 0 then minX <- g.Before + kerning
                        elif i = l.Length - 1 then cx <- cx + g.Before
                i <- i + 1
                last <- c
                
            let size = cx - minX

            
            let shift = 
                match align with
                    | TextAlignment.Left -> 0.0
                    | TextAlignment.Right -> bounds.Max.X - cx
                    | TextAlignment.Center -> bounds.Center.X - (cx + minX) / 2.0
                    | _ -> failwithf "[Text] bad align: %A" align

            let y = cy

            textBounds.ExtendBy(Box2d(V2d(minX + shift, y - font.Descent - font.InternalLeading), V2d(cx + shift, y + font.Ascent + font.InternalLeading)))

            let breakIndex = 
                if lineBounds.Count = 0 then stringOffset
                else 
                    let struct (i, _) = lineBounds.[lineBounds.Count - 1]
                    i + 1
            lineBounds.Add(struct(breakIndex, Box2d(cx, cy - font.Descent - font.InternalLeading, System.Double.PositiveInfinity, cy + font.Ascent + font.ExternalLeading)))

            boundsList.AddRange (lineBounds |> Seq.map (fun struct(i, b) -> struct(i, b.Translated(V2d(shift, 0.0)))))
            lineBounds.Clear()
            for (x,g) in chars do
                let pos = V2d(shift + x,y)
                renderBounds.ExtendBy(g.Bounds.Translated pos)
                concrete.Add {
                    trafo = M33d.Translation(pos)
                    color = color
                    z = 0
                    shape = g
                }


            cy <- cy - font.LineHeight

            stringOffset <- m.Index + m.Length
            m <- lineRx.Match(content, stringOffset)


        let realCenter = renderBounds.Center.X
        
        let concrete =
            concrete |> CSharpList.toList |> List.map (fun shape ->
                { shape with trafo = M33d.Translation(-realCenter, 0.0) * shape.trafo } 
            )

        CSharpList.toArray boundsList,
        {
            bounds              = renderBounds
            textBounds          = textBounds
            concreteShapes      = concrete
            renderTrafo         = Trafo3d.Translation(realCenter, 0.0, 0.0)
            flipViewDependent   = true
            zRange = Range1i(0,0)
            renderStyle = renderStyle
        }


