    static member Uniform(name : string, value : aval<'a>) = SceneAttribute.Uniforms(HashMap.single name (value :> IAdaptiveValue))
    static member Uniform<'a when 'a : unmanaged>(name : string, value : 'a) = SceneAttribute.Uniforms(HashMap.single name (AVal.constant value :> IAdaptiveValue))
        
    static member Uniform(values : #seq<string * obj>) =
        let meth =
            match <@ AVal.constant : int -> aval<int> @> with
            | FSharp.Quotations.DerivedPatterns.Lambdas(_, FSharp.Quotations.Patterns.Call(None, mi, _)) -> mi.GetGenericMethodDefinition()
            | _ -> failwith "bad quotation"
        SceneAttribute.Uniforms(
            values
            |> Seq.map (fun (name, value) ->
                match value with
                | :? IAdaptiveValue as v ->
                    name, v
                | _ ->
                    let t = value.GetType()
                    let m = meth.MakeGenericMethod [| t |]
                    let value = m.Invoke(null, [| value |]) :?> IAdaptiveValue
                    name, value
            )
            |> HashMap.ofSeq
        )
        
    static member Uniforms = UniformsBuilder()
        
