    static member Draw (geometry : IndexedGeometry) =
        Applicator( 
            [
                SceneAttribute.VertexAttributes(
                    geometry.IndexedAttributes |> Seq.map (fun (KeyValue(n, v)) ->
                        string n, BufferView(v)
                    )
                    |> HashMap.ofSeq
                )

                if not (isNull geometry.IndexArray) then
                    SceneAttribute.Index (Some (BufferView geometry.IndexArray))
                else
                    SceneAttribute.Index None
                
            ],
            ASet.single (Render geometry.FaceVertexCount)
        ) :> ISceneNode

    static member Text(text : aval<string>, ?font : Font, ?color : aval<C4b>, ?align : TextAlignment, ?renderStyle : RenderStyle) =
        // let color = defaultArg color (AVal.constant C4b.White)
        let config =
            {
                font = match font with | Some f -> f | None -> FontSquirrel.Hack.Regular
                color = match color with | Some c -> AVal.force c | None -> C4b.White
                align = defaultArg align TextAlignment.Left
                flipViewDependent = true
                renderStyle = defaultArg renderStyle RenderStyle.Normal
            }
                    
        let renderBounds =
            match config.align with
                | TextAlignment.Center -> Box2d(V2d(-1.0, 0.0), V2d(1.0, 0.0))
                | TextAlignment.Left -> Box2d(V2d(0.0, 0.0), V2d(1.0, 0.0))
                | _ -> Box2d(V2d(-1.0, 0.0), V2d(0.0, 0.0))

        let shape = 
            text |> AVal.map (fun str -> config.font.LayoutWithCharacterBounds(config.color, config.align, renderBounds, str, config.renderStyle))


        let coloredShape =
            match color with
            | Some v when not v.IsConstant ->
                (shape, v) ||> AVal.map2 (fun (_, s) col -> { s with concreteShapes = s.concreteShapes |> List.map (fun c -> { c with color = col }) })
            | _ ->
                shape |> AVal.map snd

        let info =
            {
                LineHeight = config.font.LineHeight
                Bounds = shape |> AVal.map (fun (_, s) -> s.bounds)
                TextBounds = shape |> AVal.map (fun (_, s) -> s.textBounds)
                GetCaretIndex = fun (p : V2d) -> 
                    let bounds, s = AVal.force shape

                    match bounds |> Array.tryFind (fun struct(_, b) -> b.Contains p) with
                    | Some (idx, b) ->
                        let index =
                            if p.X < b.Center.X then idx
                            else idx + 1
                        Some index
                    | None ->
                        None 

                GetCaretPosition = fun (idx : int) ->
                    let bounds, s = AVal.force shape
                    if bounds.Length > 0 then
                        match bounds |> Array.tryFind (fun struct(i,_) -> i = idx) with
                        | Some struct(_, b) -> 
                            let x = if System.Double.IsNegativeInfinity b.Min.X then 0.0 else  b.Min.X
                            V2d(x, b.Center.Y)
                        | None -> 
                            let struct(_, b) = bounds.[bounds.Length - 1]
                            if System.Double.IsPositiveInfinity b.Max.X then V2d(0.0, b.Center.Y - config.font.LineHeight)
                            else V2d(b.Max.X, b.Center.Y)
                    else
                        V2d(0.0, 0.5)
                            
            }

        info, sg {
            shape 
            |> AVal.map (fun (_,s) -> 
                s.bounds.EnlargedBy 0.2
                |> Intersectable.planeXY
            )
            |> Intersectable


            sg { NoEvents; Sg.shape coloredShape }

            

        }
            
    static member Text(text : string, ?font : Font, ?color : aval<C4b>, ?align : TextAlignment, ?renderStyle : RenderStyle) =
        Sg.Text(AVal.constant text, ?font = font, ?color = color, ?align = align, ?renderStyle = renderStyle)
        
    static member Delay(creator : TraversalState -> ISceneNode) =
        DelayedSceneNode(creator) :> ISceneNode


module private PrimitiveHelpers = 
    let decode<'a when 'a : unmanaged and 'a : struct and 'a : (new : unit -> 'a) and 'a :> System.ValueType> (v : string) =
        let bytes = System.Convert.FromBase64String v
        let res = Array.zeroCreate<'a> (v.Length / sizeof<'a>)

        let src = System.Span bytes
        let dst = System.Span res
        src.CopyTo(System.Runtime.InteropServices.MemoryMarshal.AsBytes(dst))
        res

[<AbstractClass; Sealed; AutoOpen>]
type Primitives private() =

    static let coneCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()
        
    static let wireConeCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()
        
    static let cylinderCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()
        
    static let wireCylinderCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()

    static let sphereCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()
        
    static let wireSphereCache = System.Collections.Concurrent.ConcurrentDictionary<int, ISceneNode>()

    static let teapot =
        lazy (
            let pos = PrimitiveHelpers.decode<V3f>  ""
            let ns = PrimitiveHelpers.decode<V3f>  ""
            let tc = PrimitiveHelpers.decode<V2f>  ""
            let idx = PrimitiveHelpers.decode<int>  ""

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray tc
                    string DefaultSemantic.Normals, BufferView.ofArray ns
                ])

                SceneAttribute.Index (Some (BufferView.ofArray idx))
                SceneAttribute.Mode IndexedGeometryMode.TriangleList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = idx.Length, InstanceCount = 1))
            }
        )
            
    static let wireTeapot =
        lazy (
            let pos = PrimitiveHelpers.decode<V3f> ""
            let ns = PrimitiveHelpers.decode<V3f> ""
            let tc = PrimitiveHelpers.decode<V2f> ""
            let idx = PrimitiveHelpers.decode<int> ""

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray tc
                    //string DefaultSemantic.Normals, BufferView.ofArray ns
                ])

