            }
        )

    static let tetrahedronScene =
        lazy (
            let a = sqrt(3.0 / 4.0)
            let b = sqrt(1.0 / 12.0)
            let c = sqrt(2.0 / 3.0)
            let s = sqrt 1.5

            let mutable p0 = s * V3d(0.0, 0.0, 0.0)
            let mutable p1 = s * V3d(1.0, 0.0, 0.0)
            let mutable p2 = s * V3d(0.5, a, 0.0)
            let mutable p3 = s * V3d(0.5, b, c)

            let c = (p0.XY + p1.XY + p2.XY + p3.XY) / 4.0
            p0 <- p0 - V3d(c, 0.0)
            p1 <- p1 - V3d(c, 0.0)
            p2 <- p2 - V3d(c, 0.0)
            p3 <- p3 - V3d(c, 0.0)

            let n012 = Vec.cross (p2 - p0) (p1 - p0) |> Vec.normalize
            let n013 = Vec.cross (p1 - p0) (p3 - p0) |> Vec.normalize
            let n023 = Vec.cross (p3 - p0) (p2 - p0) |> Vec.normalize
            let n123 = Vec.cross (p2 - p1) (p3 - p1) |> Vec.normalize

            let pos =
                [|
                    V3f p0; V3f p2; V3f p1
                    V3f p0; V3f p1; V3f p3
                    V3f p0; V3f p3; V3f p2
                    V3f p1; V3f p2; V3f p3
                |]

            let tc =
                [|
                    V2f.OO; V2f.IO; V2f(0.5, 1.0)
                    V2f.OO; V2f.IO; V2f(0.5, 1.0)
                    V2f.OO; V2f.IO; V2f(0.5, 1.0)
                    V2f.OO; V2f.IO; V2f(0.5, 1.0)
                |]

            let ns =
                [|
                    V3f n012; V3f n012; V3f n012
                    V3f n013; V3f n013; V3f n013
                    V3f n023; V3f n023; V3f n023
                    V3f n123; V3f n123; V3f n123
                |]  
            sg {
                SceneAttribute.Intersectable (AVal.constant (Intersectable.tetrahedron p0 p1 p2 p3))
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray tc
                    string DefaultSemantic.Normals, BufferView.ofArray ns
                ])

                SceneAttribute.Index None
                SceneAttribute.Mode IndexedGeometryMode.TriangleList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = 12, InstanceCount = 1))
            }
        )
            
    static let wireTetrahedronScene =
        lazy (
            let a = sqrt(3.0 / 4.0)
            let b = sqrt(1.0 / 12.0)
            let c = sqrt(2.0 / 3.0)
            let s = sqrt 1.5

            let mutable p0 = s * V3d(0.0, 0.0, 0.0)
            let mutable p1 = s * V3d(1.0, 0.0, 0.0)
            let mutable p2 = s * V3d(0.5, a, 0.0)
            let mutable p3 = s * V3d(0.5, b, c)

            let c = (p0.XY + p1.XY + p2.XY + p3.XY) / 4.0
            p0 <- p0 - V3d(c, 0.0)
            p1 <- p1 - V3d(c, 0.0)
            p2 <- p2 - V3d(c, 0.0)
            p3 <- p3 - V3d(c, 0.0)


