    static let getCone (tessellation : int) =
        coneCache.GetOrAdd(tessellation, fun tessellation ->
            let fvc = (tessellation * 6)

            let positions = Array.zeroCreate fvc
            let normals = Array.zeroCreate fvc
            let tc = Array.zeroCreate fvc

            let step = Constant.PiTimesTwo / float tessellation
            let mutable phi = 0.0
            let mutable oi = 0

            let center = V3f.OOI
            let top = V3d.Zero
            for i in 0 .. tessellation-1 do

                let cp = cos phi
                let sp = sin phi
                    
                let cp1 = cos (phi + step)
                let sp1 = sin (phi + step)

                let p0 = V3d(cp, sp, 1.0)
                let p1 = V3d(cp1, sp1, 1.0)
                let p2 = top

                let n0 = V3d(cp, sp, -1.0) * Constant.Sqrt2Half
                let n1 = V3d(cp1, sp1, -1.0) * Constant.Sqrt2Half
                let n2 = Vec.normalize (n0 + n1)

                let cx = phi / Constant.PiTimesTwo
                let cx1 = (phi + step) / Constant.PiTimesTwo
                let cxm = 0.5 * (cx + cx1)

                positions.[oi] <- V3f p0; normals.[oi] <- V3f n0; tc.[oi] <- V2f(cx, 0.0); oi <- oi + 1
                positions.[oi] <- V3f p2; normals.[oi] <- V3f n2; tc.[oi] <- V2f(cxm, 1.0); oi <- oi + 1
                positions.[oi] <- V3f p1; normals.[oi] <- V3f n1; tc.[oi] <- V2f(cx1, 0.0); oi <- oi + 1

                positions.[oi] <- V3f p0; normals.[oi] <- V3f.OOI; tc.[oi] <- V2f(0.5 * cp + 0.5, 0.5 * sp + 0.5); oi <- oi + 1
                positions.[oi] <- V3f p1; normals.[oi] <- V3f.OOI; tc.[oi] <- V2f(0.5 * cp1 + 0.5, 0.5 * sp1 + 0.5); oi <- oi + 1
                positions.[oi] <- center; normals.[oi] <- V3f.OOI; tc.[oi] <- V2f.Half; oi <- oi + 1

                phi <- phi + step

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray positions
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray tc
                    string DefaultSemantic.Normals, BufferView.ofArray normals
                ])

                SceneAttribute.Index None
                SceneAttribute.Mode IndexedGeometryMode.TriangleList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = fvc, InstanceCount = 1))
            }
        )
            
