    static let getCylinder (tessellation : int) =
        cylinderCache.GetOrAdd(tessellation, fun tessellation ->
            let vertexCount = 4 * (tessellation + 1) + 2
            let indexCount = tessellation * 12
            let pos = Array.zeroCreate<V3f> vertexCount
            let tc = Array.zeroCreate<V2f> vertexCount
            let ns = Array.zeroCreate<V3f> vertexCount


            let step = Constant.PiTimesTwo / float tessellation

            let mutable oi = 0
            let mutable phi = 0.0
            for i in 0 .. tessellation do
                let c = cos phi
                let s = sin phi

                let p0 = V3d(c, s, 0.0)
                let p1 = V3d(c, s, 1.0)

                let n0 = V3f.OON
                let n1 = V3f.OOI
                let n = V3f(c, s, 0.0)

                let cx = phi / Constant.PiTimesTwo
                let cc = V2f(0.5 * c + 0.5, 0.5 * s + 0.5)

                pos.[oi] <- V3f p0; ns.[oi] <- n0; tc.[oi] <- cc; oi <- oi + 1
                pos.[oi] <- V3f p0; ns.[oi] <- n; tc.[oi] <- V2f(cx, 0.0); oi <- oi + 1
                pos.[oi] <- V3f p1; ns.[oi] <- n1; tc.[oi] <- cc; oi <- oi + 1
                pos.[oi] <- V3f p1; ns.[oi] <- n; tc.[oi] <- V2f(cx, 1.0); oi <- oi + 1

                phi <- phi + step

            let bottom = oi
            pos.[oi] <- V3f.Zero; ns.[oi] <- V3f.OON; tc.[oi] <- V2f.Half; oi <- oi + 1
            let top = oi
            pos.[oi] <- V3f.OOI; ns.[oi] <- V3f.OOI; tc.[oi] <- V2f.Half; oi <- oi + 1


                 
            if oi <> pos.Length then Log.warn "bad vertex-count in cylinder: %A vs %A" oi pos.Length

            let indices = Array.zeroCreate<int> indexCount
            let mutable oi = 0
            for i in 0 .. tessellation - 1 do
                let inline getIndex (i : int) (side : bool) (top : bool) =
                    4*i + (if top then 2 else 0) + (if side then 1 else 0)

                let i00 = getIndex i true false
                let i10 = getIndex (i+1) true false
                let i01 = getIndex i true true
                let i11 = getIndex (i+1) true true

                indices.[oi] <- i00; oi <- oi + 1
                indices.[oi] <- i10; oi <- oi + 1
                indices.[oi] <- i01; oi <- oi + 1

                indices.[oi] <- i01; oi <- oi + 1
                indices.[oi] <- i10; oi <- oi + 1
                indices.[oi] <- i11; oi <- oi + 1

                    
                let i00 = getIndex i false false
                let i10 = getIndex (i+1) false false
                let i01 = getIndex i false true
                let i11 = getIndex (i+1) false true
                    
                indices.[oi] <- i00; oi <- oi + 1
                indices.[oi] <- bottom; oi <- oi + 1
                indices.[oi] <- i10; oi <- oi + 1
                    
                indices.[oi] <- i01; oi <- oi + 1
                indices.[oi] <- i11; oi <- oi + 1
                indices.[oi] <- top; oi <- oi + 1

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray tc
                    string DefaultSemantic.Normals, BufferView.ofArray ns
                ])

                SceneAttribute.Index (Some (BufferView.ofArray indices))
                SceneAttribute.Mode IndexedGeometryMode.TriangleList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = indices.Length, InstanceCount = 1))
            }
        )
        
