    static let getSphere (tessellation : int) =
        sphereCache.GetOrAdd(tessellation, fun tessellation ->
            
            let h = tessellation / 2

            let dPhi = Constant.PiTimesTwo / float tessellation
            let dTheta = Constant.Pi / float h

            let mutable phi = 0.0
            let mutable theta = -Constant.PiHalf + dTheta

            let pos = Array.zeroCreate<V3f> ((tessellation + 1) * (h-1) + 2*tessellation)
            let uv = Array.zeroCreate<V2f> pos.Length
            let mutable oi = 0

            for y in 1 .. h - 1 do
                phi <- 0.0
                let c = cos theta
                let s = sin theta
                for x in 0 .. tessellation do
                    let v = V3f(cos phi * c, sin phi * c, s)
                    let c = V2d(phi, theta + Constant.PiHalf) / V2d(Constant.PiTimesTwo, Constant.Pi)
                    pos.[oi] <- v; uv.[oi] <- V2f c; oi <- oi + 1
                    phi <- phi + dPhi

                theta <- theta + dTheta
                    
            let n = oi
            phi <- dPhi / 2.0
            for i in 0 .. tessellation - 1 do
                pos.[oi] <- V3f.OOI; uv.[oi] <- V2f(phi/Constant.PiTimesTwo, 1.0); oi <- oi + 1
                phi <- phi + dPhi

            let s = oi
            phi <- dPhi / 2.0
            for i in 0 .. tessellation - 1 do
                pos.[oi] <- V3f.OON; uv.[oi] <- V2f(phi/Constant.PiTimesTwo, 0.0); oi <- oi + 1
                phi <- phi + dPhi

            let faces = 3 * (2*tessellation + 2*(h-2)*tessellation)
            let mutable oi = 0
            let idx = Array.zeroCreate<int> faces
                
            // bottom
            for x in 0 .. tessellation - 1 do
                let i = x
                idx.[oi] <- i; oi <- oi + 1
                idx.[oi] <- s + x; oi <- oi + 1
                idx.[oi] <- i+1; oi <- oi + 1

            // top
            let o = (h-2) * (tessellation+1)
            for x in 0 .. tessellation - 1 do
                let i = o + x
                idx.[oi] <- n + x; oi <- oi + 1
                idx.[oi] <- i; oi <- oi + 1
                idx.[oi] <- i+1; oi <- oi + 1

            // interior
            for y in 1 .. h - 2 do
                let o0 = (y - 1)*(tessellation + 1)
                let o1 = y*(tessellation + 1)

                for x in 0 .. tessellation - 1 do
                    let i00 = o0 + x+1
                    let i01 = o1 + x+1
                    let i10 = o0 + x
                    let i11 = o1 + x

                    idx.[oi] <- i10; oi <- oi + 1
                    idx.[oi] <- i00; oi <- oi + 1
                    idx.[oi] <- i01; oi <- oi + 1
                        
                    idx.[oi] <- i10; oi <- oi + 1
                    idx.[oi] <- i01; oi <- oi + 1
                    idx.[oi] <- i11; oi <- oi + 1

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray uv
                    string DefaultSemantic.Normals, BufferView.ofArray pos
                ])

                SceneAttribute.Index (Some (BufferView.ofArray idx))
                SceneAttribute.Mode IndexedGeometryMode.TriangleList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = idx.Length, InstanceCount = 1))
            }
        )
        
    static let getWireSphere (tessellation : int) =
        wireSphereCache.GetOrAdd(tessellation, fun tessellation ->
            
            let h = tessellation / 2

            let dPhi = Constant.PiTimesTwo / float tessellation
            let dTheta = Constant.Pi / float h

            let mutable phi = 0.0
            let mutable theta = -Constant.PiHalf + dTheta

            let pos = Array.zeroCreate<V3f> ((tessellation + 1) * (h-1) + 2*tessellation)
            let uv = Array.zeroCreate<V2f> pos.Length
            let mutable oi = 0

            for y in 1 .. h - 1 do
                phi <- 0.0
                let c = cos theta
                let s = sin theta
                for x in 0 .. tessellation do
                    let v = V3f(cos phi * c, sin phi * c, s)
                    let c = V2d(phi, theta + Constant.PiHalf) / V2d(Constant.PiTimesTwo, Constant.Pi)
                    pos.[oi] <- v; uv.[oi] <- V2f c; oi <- oi + 1
                    phi <- phi + dPhi

                theta <- theta + dTheta
                    
            let n = oi
            phi <- dPhi / 2.0
            for i in 0 .. tessellation - 1 do
                pos.[oi] <- V3f.OOI; uv.[oi] <- V2f(phi/Constant.PiTimesTwo, 1.0); oi <- oi + 1
                phi <- phi + dPhi

            let s = oi
            phi <- dPhi / 2.0
            for i in 0 .. tessellation - 1 do
                pos.[oi] <- V3f.OON; uv.[oi] <- V2f(phi/Constant.PiTimesTwo, 0.0); oi <- oi + 1
                phi <- phi + dPhi

            let lines = tessellation * (6 + 4*(h-2))
            let mutable oi = 0
            let idx = Array.zeroCreate<int> lines
                
            // bottom
            for x in 0 .. tessellation - 1 do
                let i = x
                idx.[oi] <- i; oi <- oi + 1
                idx.[oi] <- i+1; oi <- oi + 1
                    
                idx.[oi] <- i+1; oi <- oi + 1
                idx.[oi] <- s + x; oi <- oi + 1

            // top
            let o = (h-2) * (tessellation+1)
            for x in 0 .. tessellation - 1 do
                let i = o + x
                idx.[oi] <- i+1; oi <- oi + 1
                idx.[oi] <- n + x; oi <- oi + 1

            // interior
            for y in 1 .. h - 2 do
                let o0 = (y - 1)*(tessellation + 1)
                let o1 = y*(tessellation + 1)

                for x in 0 .. tessellation - 1 do
                    let i00 = o0 + x+1
                    let i01 = o1 + x+1
                    let i10 = o0 + x
                    let i11 = o1 + x

                    idx.[oi] <- i10; oi <- oi + 1
                    idx.[oi] <- i11; oi <- oi + 1

                    idx.[oi] <- i11; oi <- oi + 1
                    idx.[oi] <- i01; oi <- oi + 1

            sg {
                SceneAttribute.VertexAttributes (HashMap.ofList [
                    string DefaultSemantic.Positions, BufferView.ofArray pos
                    string DefaultSemantic.DiffuseColorCoordinates, BufferView.ofArray uv
                    string DefaultSemantic.Normals, BufferView.ofArray pos
                ])

                SceneAttribute.Index (Some (BufferView.ofArray idx))
                SceneAttribute.Mode IndexedGeometryMode.LineList
                DirectDrawNode(DrawCallInfo(FaceVertexCount = idx.Length, InstanceCount = 1))
            }
        )
 
 
