    static member Cone(cone : aval<Cone3d>, color : aval<C4b>, ?tessellation : int) =
        let tessellation = defaultArg tessellation 64

        let trafo =
            cone |> AVal.map (fun c ->
                let h = Vec.length c.Direction
                let r = c.GetRadius h
                    
                Trafo3d.Scale(r, r, h) *
                Trafo3d.RotateInto(V3d.OOI, c.Direction / h) *
                Trafo3d.Translation(c.Origin)
            )
        let colorBuffer = color |> AVal.map (fun c -> c.ToC4f().ToV4f()) |> SingleValueBuffer


        sg {
            SceneAttribute.Intersectable (cone |> AVal.map Intersectable.cone)
            SceneAttribute.Model [trafo]
            SceneAttribute.VertexAttributes (HashMap.ofList [
                string DefaultSemantic.Colors, BufferView(colorBuffer, typeof<V4f>)
            ])
            getCone tessellation
        }

