    static member Quad(quad : aval<Quad3d>, color : aval<C4b>) =
        sg {
                
            let pos = quad |> AVal.map (fun q -> ArrayBuffer [| V3f q.P0; V3f q.P1; V3f q.P2; V3f q.P3 |] :> IBuffer)
            let ns = 
                quad |> AVal.map (fun q -> 
                    let n = V3f q.Normal
                    ArrayBuffer [|n; n; n; n|] :> IBuffer
                )
            let index = [| 0; 1; 3; 3; 1; 2|]
            let colorBuffer = color |> AVal.map (fun c -> c.ToC4f().ToV4f()) |> SingleValueBuffer
            SceneAttribute.Index (Some (BufferView.ofArray index))
            SceneAttribute.VertexAttributes (HashMap.ofList [
                string DefaultSemantic.Positions, BufferView(pos, typeof<V3f>)
                string DefaultSemantic.Normals, BufferView(ns, typeof<V3f>)
                string DefaultSemantic.Colors, BufferView(colorBuffer, typeof<V4f>)
            ])
            SceneAttribute.Mode IndexedGeometryMode.TriangleList
            Sg.Render(index.Length)
        }
            
