    static member Polygon(polygon : aval<Polygon3d>, color : aval<C4b>, ?tessellationRule : TessellationRule) =
        let tessellationRule = defaultArg tessellationRule TessellationRule.EvenOdd
        let triangulated =
            polygon |> AVal.map (fun p ->
                let tris =
                    Aardvark.Geometry.PolygonTessellator.Triangulate([p], tessellationRule)
                    |> List.toArray
                       
                let positions = Array.zeroCreate (3 * tris.Length)
                let normals = Array.zeroCreate positions.Length
                let mutable oi = 0
                for t in tris do 
                    let n = t.Normal
                    positions.[oi] <- V3f t.P0; normals.[oi] <- V3f n; oi <- oi + 1
                    positions.[oi] <- V3f t.P1; normals.[oi] <- V3f n; oi <- oi + 1
                    positions.[oi] <- V3f t.P2; normals.[oi] <- V3f n; oi <- oi + 1

                positions, normals

            )

        let pBuffer = BufferView(triangulated |> AVal.map (fun (p,_) -> ArrayBuffer p :> IBuffer), typeof<V3f>)
        let nBuffer = BufferView(triangulated |> AVal.map (fun (_,n) -> ArrayBuffer n :> IBuffer), typeof<V3f>)
        let cBuffer = color |> AVal.map (fun c -> c.ToC4f().ToV4f()) |> SingleValueBuffer
                
        sg {
            SceneAttribute.Index None
            SceneAttribute.VertexAttributes (HashMap.ofList [
                string DefaultSemantic.Positions, pBuffer
                string DefaultSemantic.Normals, nBuffer
                string DefaultSemantic.Colors, BufferView(cBuffer, typeof<V4f>)
            ])
            SceneAttribute.Mode IndexedGeometryMode.TriangleList
            Sg.Render(triangulated |> AVal.map (fun (p, _) -> p.Length))
        }
            
