    static member WirePolygon(polygon : aval<Polygon3d>, color : aval<C4b>) =
        let edgeLines =
            polygon |> AVal.map (fun p ->
                if p.PointCount >= 3 then
                    let plane = p.GetPlane3d()
                    let c = p.ComputeCentroid()

                    let toPolygon2d = 
                        Trafo3d.Translation(-c) *
                        Trafo3d.RotateInto(plane.Normal, V3d.OOI)

                    let polygons = 
                        p.GetPointArray() 
                        |> Array.map (toPolygon2d.Forward.TransformPos >> Vec.xy) 
                        |> PolyRegion.ofArray
                        |> PolyRegion.toPolygons
                        
                    let positions = 
                        polygons 
                        |> Seq.collect (fun p -> 
                            p.EdgeLines 
                            |> Seq.collect (fun l -> [l.P0; l.P1])
                        ) 
                        |> Seq.map (fun p -> V3f (toPolygon2d.Backward.TransformPos(V3d(p, 0.0)))) 
                        |> Seq.toArray

                    positions
                else
                    [||]
                   

            )

        let pBuffer = BufferView(edgeLines |> AVal.map (fun p -> ArrayBuffer p :> IBuffer), typeof<V3f>)
        let cBuffer = color |> AVal.map (fun c -> c.ToC4f().ToV4f()) |> SingleValueBuffer
                
        sg {
            SceneAttribute.Index None
            SceneAttribute.VertexAttributes (HashMap.ofList [
                string DefaultSemantic.Positions, pBuffer
                string DefaultSemantic.Colors, BufferView(cBuffer, typeof<V4f>)
            ])
            SceneAttribute.Mode IndexedGeometryMode.LineList
            Sg.Render(edgeLines |> AVal.map (fun p -> p.Length))
        }
            
